import "./PokemonInfo.css";

function PokemonInfo({ pokemonTarget, onClick }) {
  return (
    <div className="containerPokemonInfo">
      <div className="PokemonCard">
        <div className="ContainerId">{pokemonTarget.id}</div>
        <div className="containerPokemonWhite">
          <div className="containerImagePokemon">
            <img
              className="imagePokemon"
              src={pokemonTarget.image}
              alt="image"
            ></img>
          </div>

          <div className="ContainerNamePokemon">{pokemonTarget.name}</div>
        </div>
        {pokemonTarget.types.map((type) => (
          <div key={type} className="PokemonTargetTypes">
            {type}
          </div>
        ))}
      </div>
      <button className="closeButton" onClick={onClick}>
        X
      </button>
    </div>
  );
}

export default PokemonInfo;
